import React from 'react';
import '../assets/styles/Login.css'

function Login() {
  return(
    <div className="Log_in">
          <input type="text" placeholder="name" name="name" />
          <input type="password" placeholder="password" name="password" />
        <button>Login</button>
    </div>
  )
}
export default Login;
